volatile long presc = 0;

void TimerIsr() {
	presc++;
	if ((presc / 250) % 2)
		RegisterSet(GPSET1, 1 << (35 - 32));
	else
		RegisterSet(GPCLR1, 1 << (35 - 32));
	if ((presc / 500) % 2)
		RegisterSet(GPSET1, 1 << (47 - 32));
	else
		RegisterSet(GPCLR1, 1 << (47 - 32));
}

